def string_expansion(s):
    if not s:
        return ""

    result = ""
    i = 0
    while i < len(s):
        if s[i].isdigit():
            count = int(s[i])
            i += 1
            prev_char = ""
            while i < len(s) and s[i].isdigit():
                i += 1
            for _ in range(count):
                if i < len(s):
                    char = s[i]
                    if prev_char:
                        result += char * count
                    else:
                        result += char
                    prev_char = char
                else:
                    break
        else:
            if i < len(s):
                result += s[i]
            i += 1

    return result

